// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./SyndicateClosedEndFundLogic.sol";

/// @author Syndicate Inc.
/// @notice General public controls and getters
contract SyndicateClosedEndFundGetterLogicV0 is SyndicateClosedEndFundLogic {
    /// @notice Used to initialize the Syndicate contract.
    constructor(address storeAddress)
        SyndicateClosedEndFundLogic(storeAddress)
    {}

    /// @dev All PRs that modify this struct *must* be coordinated with an
    /// engineer on the Web3 dashboard, because it is returned directly by
    /// `getSyndicateValues()`
    struct SyndicateValues {
        address managerCurrent;
        address managerPending;
        address managerFeeAddress;
        uint256 managerManagementFeeBasisPoints;
        uint256 managerPerformanceFeeBasisPoints;
        uint256 syndicateProfitShareBasisPoints;
        uint256 numMembersMax;
        uint256 numMembersCurrent;
        address depositERC20Address;
        uint256 depositMinMember;
        uint256 depositMaxMember;
        uint256 depositMaxTotal;
        uint256 depositTotal;
        uint256 dateCreation;
        uint256 dateClose;
        bool open;
        bool distributing;
        bool allowlistEnabled;
        bool modifiable;
        bool transferable;
    }

    struct MemberInfo {
        uint256 deposit;
        // member's claimed distributions (withdrawals) from the *primary* ERC20
        uint256 claimedDistributionPrimary;
        bool addressAllowed;
    }

    // Functions----------------------------------------------------------------

    /// @notice Get the values for a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @return SyndicateValues struct
    /// @dev This function **must** be kept up to date with the web3 UI when
    /// making changes. All PRs that change this function or the
    /// SyndicateValues struct **must** be coordinated with an engineer on the
    /// Web3 Dashboard.
    function getSyndicateValues(address syndicateAddress)
        public
        view
        returns (SyndicateValues memory)
    {
        return
            SyndicateValues({
                managerCurrent: store.managerCurrent(syndicateAddress),
                managerPending: store.managerPending(syndicateAddress),
                managerFeeAddress: store.managerFeeAddress(syndicateAddress),
                managerManagementFeeBasisPoints: store
                    .managerManagementFeeBasisPoints(syndicateAddress),
                managerPerformanceFeeBasisPoints: store
                    .managerPerformanceFeeBasisPoints(syndicateAddress),
                syndicateProfitShareBasisPoints: store
                    .syndicateProfitShareBasisPoints(syndicateAddress),
                numMembersMax: store.numMembersMax(syndicateAddress),
                numMembersCurrent: store.numMembersCurrent(syndicateAddress),
                depositERC20Address: store.depositERC20Address(
                    syndicateAddress
                ),
                depositMinMember: store.depositMinMember(syndicateAddress),
                depositMaxMember: store.depositMaxMember(syndicateAddress),
                depositMaxTotal: store.depositMaxTotal(syndicateAddress),
                depositTotal: store.depositTotal(syndicateAddress),
                dateCreation: store.dateCreation(syndicateAddress),
                dateClose: store.dateClose(syndicateAddress),
                open: store.open(syndicateAddress),
                distributing: store.distributing(syndicateAddress),
                allowlistEnabled: store.allowlistEnabled(syndicateAddress),
                modifiable: store.modifiable(syndicateAddress),
                transferable: store.transferable(syndicateAddress)
            });
    }

    /// @notice Get the member info for a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddress The address of the member whose info is being
    /// queried
    /// @return MemberInfo struct
    /// @notice To get the claimed distributions for another ERC20, use
    /// `getDistributionClaimedMember()`
    /// @dev This function **must** be kept up to date with the Web3 UI when
    /// making changes. All PRs that change this function **must** be
    /// coordinated with an engineer on the Web3 Dashboard.
    function getMemberInfo(address syndicateAddress, address memberAddress)
        public
        view
        returns (MemberInfo memory)
    {
        return
            MemberInfo({
                deposit: store.depositMember(syndicateAddress, memberAddress),
                claimedDistributionPrimary: store.distributionClaimedMember(
                    syndicateAddress,
                    store.depositERC20Address(syndicateAddress),
                    memberAddress
                ),
                addressAllowed: store.addressAllowed(
                    syndicateAddress,
                    memberAddress
                )
            });
    }

    /// @notice Get the metadata for a given key within a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param metadataKey The string that is the key of the metadata to look up
    /// @return metadataValue as a string
    function getMetadata(address syndicateAddress, string calldata metadataKey)
        public
        view
        returns (string memory)
    {
        return store.metadata(syndicateAddress, metadataKey);
    }
}

